import { Col, Container, Row } from "react-bootstrap";
import '../Home.css';

function Home() {
    return (
        <Container className="Home">
            <Row>
                <Col>
                    <div>
                        <h1>Welcome To Portfolio.</h1>
                    </div>
                </Col>
            </Row>
        </Container>
    );
}

export default Home;
